// File: src/pages/CreateVendor.js
import React, { useState } from 'react';
import { createVendor } from '../services/api';

const CreateVendor = () => {
  const [vendor, setVendor] = useState({ vendorId: '', contact: '', location: '' });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setVendor((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createVendor(vendor);
      setMessage('Vendor created successfully!');
      setVendor({ vendorId: '', contact: '', location: '' });
    } catch (err) {
      setMessage('Failed to create vendor.');
    }
  };

  return (
    <div>
      <h1>Create Vendor</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="vendorId"
          placeholder="Vendor ID"
          value={vendor.vendorId}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="contact"
          placeholder="Contact"
          value={vendor.contact}
          onChange={handleChange}
        />
        <input
          type="text"
          name="location"
          placeholder="Location"
          value={vendor.location}
          onChange={handleChange}
        />
        <button type="submit">Create Vendor</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
};

export default CreateVendor;
